import React, {Component} from "react";
import BorderWrapper from "react-border-wrapper";



class Example extends React.Component {
    render () {
      return (
        <BorderWrapper
            borderColour="#00bcf1"
            borderWidth="5px"
            borderRadius="15px"
            borderType="Solid"
            innerPadding="30px"
            display="flex"
            >

        </BorderWrapper>
      )
    }
  }
